INSERT INTO `events` VALUES (1,1,6,NULL,3,'','مغناطيسية العلاقات','<br>','| دورة مغناطيسية العلاقات |<br><br>دورة متخصصة فقط لعلاقاتك بالآخرين<br>( الزوج / الزوجة / علاقات العمل / الوالدين / العلاقات الاجتماعية الاخرى )<br><br>الشريحة المستفيدة من هذه الورشة :<br>|١- كل شخص يجد صعوبة في التواصل مع شريك حياته.<br>|٢- لكل شخص يعاني&nbsp; من كثرة الصِدامات مع الآخرين.<br>|٣- المقبلين على الزواج والمتزوجين.<br>|٤- لكل من يتعامل بكثرة مع الآخرين بالعمل.<br>|٥- للمشاهير وأصحاب الأعمال .<br>|٦- المدراء والمسؤولين في جهات عملهم.<br>|٧- لكل شخص يرغب بعمل سيستم خاص مميز لعلاقاته.<br><br>محاور الورشة:<br>|- مصدر هدفك الرئيسي وطرق الاتصال فيه.<br>|- تدريب العقل على الالتزام/ الالغاء/ الاخفاء/الاختيار.<br>|- قانون الجذب والتدريب على سر التعامل معه.<br>|- المناعة من النسخة السيئة لعلاقاتك وتحرير النسخة التي تريد منها.<br>|- معرفة اذا كانت العلاقة داخلية او خارجية، وفك الارتباط فيها.<br>|- تمرين المغناطيسية لتحويل هذه العلاقة من القطب الموجب إلى القطب السالب.<br>|- الرسالة من وجود هذا الشخص في حياتك .<br>',NULL,0,125.00,0,0,'2014-10-10 19:00:00','2014-10-11 01:00:00','00965-987788776','','','دبي - فندق الشنغريلا','','طريق الشيخ زايد',29.357000,47.951000,NULL,'Register','سجل','2014-10-10 17:36:29','2014-12-29 01:31:30',NULL),(2,10,6,NULL,4,'','ورشة نظام الطاقة المناعي','<br>','محاور ورشة عمل ( نظام المناعة الطاقي ) <br><br>١- طريقة لمعرفة مناعة جسمك إتجاة أفكارك وأهدافك والأشخاص <br><br>٢- زيادة وتنشيط نظام المناعة إتجاة الأفكار السلبية والأشخاص والأحداث <br><br>٣- المناعة المستقبلية لكل فكرة او حدث تشعر بالخوف منة <br><br>٤- التحكم بشعورك إتجاة الأحداث من حولك <br><br>٥- عمل مناعة خاصة إتجاة ( عدم الزواج - الفقر - المرض - الألم - عدم الإنجاب - الهجران - الحسد )<br>',NULL,0,75.00,0,0,'2014-10-18 23:00:00','2014-10-19 01:00:00','0','','','Online','','Electa',29.357000,47.951000,NULL,'Register','سجل','2014-10-14 00:19:16','2014-11-09 19:53:17',NULL),(9,11,28,NULL,1,'','بدي كنترول | BodyControl','','<p class=\"fr-tag\"><span id=\"docs-internal-guid-85fc5b30-6ab6-c430-db0a-8394ea24265d