\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody class=\"mcnCaptionBlockOuter\">\r\n<tr>\r\n<td class=\"mcnCaptionBlockInner\" valign=\"top\">\r\n<table class=\"mcnCaptionRightContentOuter\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td class=\"mcnCaptionRightContentInner\" valign=\"top\">\r\n<table class=\"mcnCaptionRightTextContentContainer\" border=\"0\" width=\"352\" cellspacing=\"0\" cellpadding=\"0\" align=\"right\">\r\n<tbody>\r\n<tr>\r\n<td class=\"mcnTextContent\" valign=\"top\">\r\n<h1 dir=\"rtl\">الزمكان - الكويت</h1>\r\n<div dir=\"rtl\">| تقديم &nbsp; &nbsp;&nbsp;&nbsp; &nbsp;:<strong>&nbsp;أ. ليلى كايزن | LailaKaizen</strong><br />| التاريخ &nbsp; &nbsp; &nbsp;:<strong>&nbsp;5 - 6 مارس 2015</strong><br />| مدة الدورة :<strong> يومين - بمعدل 5&nbsp;ساعات / يوم</strong><br />| التوقيت &nbsp; &nbsp; :<strong> 4:00 - 9:00 مساءاً</strong><br />| المكان &nbsp; &nbsp; &nbsp; :<strong>&nbsp;قاعة كايزن للمؤتمرات - برج الصفاة الدور 25&nbsp;</strong><br />&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; #مدينة الكويت - قبلة،&nbsp;مقابل مجمع المثنى&nbsp;<br />&nbsp;</div>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class=\"mcnBoxedTextBlock\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody class=\"mcnBoxedTextBlockOuter\">\r\n<tr>\r\n<td class=\"mcnBoxedTextBlockInner\" valign=\"top\">\r\n<table class=\"mcnBoxedTextContentContainer\" border=\"0\" width=\"599\" cellspacing=\"0\" cellpadding=\"0\" align=\"left\">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<table class=\"mcnTextContentContainer\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"18\">\r\n<tbody>\r\n<tr>\r\n<td class=\"mcnTextContent\" valign=\"top\">\r\n<div dir=\"rtl\"><strong>محاور الدورة</strong></div>\r\n<div dir=\"rtl\">\r\n<div><br />ما بعد التوافق الذبذبي وقانون الجذب، تأتي ليلى كايزن بمفهوم حديث \"الزمكان\"، الذي من خلاله تستطيع أن تصنع احتمالاتك التي تريد، من خلال مفهوم الزمن والمكان، السرعة والزمن والمسافة، وزيادة السرعة الزمنية لديك، ولأول مرة أحدث طريقة لإبعاد ذاكرة وإنشاء ذاكرة جديدة.<br /><br />&bull;\r\n<div>الزمكان</div>\r\n<div>&nbsp;</div>\r\n<div>أحدث نظرية نقدمها لكم للتحسين من حياتك الإنسانية.</div>\r\n<div>&nbsp;</div>\r\n<div>النظرية تعتمد على المعنى الحقيقي للزمن والمكان، حيث أنهما هما المحركان للمعلومات.&nbsp;</div>\r\n<div>من خلاله تنتقل من عصر المعلومات إلى عصر الموجات والذي لايعتمد على شعورك أو نسبيتك.لذلك هي تناسب من يحب أن يخطط لأهدافه بسهولة.</div>\r\n<div>&nbsp;</div>\r\n<div>النظرية التي تنقلك من عالم الخوف من المشاعر إلى فهم المشاعر.</div>\r\n<div>&nbsp;</div>\r\n<div>كيف ممكن تستفيد من هذا البرنامج التدريبي؟</div>\r\n<div>&nbsp;</div>\r\n<div>-التخلص من الخوف بسرعة&nbsp;</div>\r\n<div>-الدخول إلى مرحلة وعي متقدمة&nbsp;</div>\r\n<div>-الاتصال بالعقل والذاكرة بشكل أسرع</div>\r\n<div>-القدرة على صنع احتمالات جديدة لك وللآخرين</div>\r\n<div>-نقل الذاكرة من مكان لآخر&nbsp;</div>\r\n<div>-الاتصال مع نفسك وزيادة قوة المراقبة لديك</div>\r\n<div>-معرفة مصادر &nbsp;ماتريد ومالاتريد</div>\r\n<div>-التخلص من الذكريات والآلام المعيقة</div>\r\n<div>-رفع مستوى الموجات لعقلك وجسدك</div>\r\n<div>-التخطيط لأهدافك وصناعة نسخة جديدة منك.</div>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div>التطبيقات العملية&nbsp;</div>\r\n<div>يتم تطبيق النظرية عمليا خلال يوميا..</div>\r\n<div>تطبيق عملي لإلغاء ذاكرة ترغب بالتخلص منها أو تغييرها، وسنعمل هل عمل ذلك أمام الجمهور بنتيجة فورية.&nbsp;</div>\r\n<div>تطبيق عملي لإنشاء ذاكرة جديدة لك وهي أحدث طريقة للتخطيط لمخططاتك وتغيير إحتمالات الآخرين في عالمك.</div>\r\n</div>\r\n<div>\r\n<div>&bull;<br /><br />&nbsp;</div>\r\n<div>| سعر الدورة 128 د.ك | للتسجيل المبكر .<br /><br /><em>*آخر موعد للتسجيل المبكر 30 / 2 / 2015 م</em></div>\r\n</div>\r\n</div>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>',NULL,0,NULL,NULL,0,'2015-03-05 20:17:00','2015-03-06 20:17:00','','','','الكويت - مدينة الكويت، قبلة مركز الصفاة - الدور ٢٦','','شارع عبدالله السالم',29.357000,47.951000,1,'Register','سجل','2015-02-01 20:18:34','2015-02-17 23:59:53',NULL);
