INSERT INTO `posts` VALUES (1,6,5,'','كايزن قروب | الإمارات','','<p dir=\"rtl\">التجمع التطوعي \"<strong>كايزن قروب</strong>\" يتسع إلى محبيه في الإمارات حيث تم أول تجمع لكايزن قروب - الإمارات - في يوم الخميس&nbsp;<br />الموافق 9/10/2014 م في دبي - حديقة الصفا ، وذلك مع الرائعين ليلى العنزي ومشاري المضاحكة مع أكثر من ٥٠ محب<br />تم إلتقائهم وتناول عدة مواضيع تهم الحياة والعيش الطيب وكان أبرزها | أسباب تأخير انجازك لمخططاتك | واحتوى الحوار أيضاً<br />على أطراف حديث إضافية تدعم الموضوع ، ولاقى الجميع الفائدة والمتعة في هذا اللقاء .<br /><br /><br /></p>','2014-10-10 17:49:37','2015-01-12 13:25:33',NULL),(2,6,9,'','كايزنيات | Color Tapping','','<span>فعالية أسبوعية تقدمها الاستشارية \"هدى يعقوب\" عن تقنيات تتحكم بألوان الضوء وتأثيرها على الظل بالتابينج ، مما يساعد على تفتيح البشرة وإضاءة المناطق المظللة في الجسم <div><br></div></span>','2014-10-12 21:21:29','2014-10-12 21:21:29',NULL),(3,6,9,'','كايزنيات | كايزن قروب','<br>','<div style=\"text-align: right;\"><span style=\"font-size: 1.2em; line-height: 1.428571429;\"><b>كايزن قروب</b> تجمع أسبوعي تطوعي له تاريخ حافل في مجال التنمية الذاتية ابتدأ من سنة 2011 م ،</span><span style=\"font-size: 1.2em; line-height: 1.428571429;\">&nbsp;</span><span style=\"font-size: 1.2em; line-height: 1.428571429;\">وعلى مدى ٣ سنوات متتالية يجتمع فيه المحبين كل أسبوع - يوم الأثنين - في مكان التجمع ويُحكى فيه عن&nbsp;</span><span style=\"font-size: 1.2em; line-height: 1.428571429;\">موضوعات متفرقة تلامس ذاتك وحياتك ، مابين آخر العلوم ،علوم التنمية الذاتية ، والطاقة الحيوية .</span></div><div style=\"text-align: right;\"><span style=\"font-size: 1.2em; line-height: 1.428571429;\"><br></span></div><span><div style=\"text-align: right;\"><span style=\"font-size: 1.2em; line-height: 1.428571429;\">تم دعم التجمع مؤخراً من قبل \"شركة كايزن\" وتبنت نشر واستمرارية هذا العطاء ، وأيضاً نشكر شركة OxygenCafe على استضافتهم لهذا التجمع كل أسبوع وتبني أمور التنظيم للسيارات وأيضاً الضيافة</span><span style=\"font-size: 1.2em; line-height: 1.428571429;\">&nbsp;، وتمت مشاركة الكثير من المتحدثين في هذا التجمع الأسبوعي ، والمتحدثين الرسميين حالياً من شركة كايزن&nbsp;</span></div><div style=\"text-align: right;\"><span style=\"font-size: 1.2em; line-height: 1.428571429;\"><br></span></div><div style=\"text-align: right;\"><span style=\"font-size: 1.2em; line-height: 1.428571429;\">| أ. ليلى العنزي (ليلى كايزن) ، أ. مشاري المضاحة ، أ. أسماء الحداد ، و أ. هدى يعقوب ، تجمع رائع يجمع نخبة المتحدثين لدى كايزن يشاركون فيه آخر وأجمل المعلومات للذات والحياة ، هو فعلاً انتعاش اسبوعي لجمال ذاتك .</span></div></span>','2014-10-12 21:23:28','2014-11-04 00:03:44',NULL),(4,6,9,'','كايزنيات | BodyControl','','<span>BodyControl أحد الفعاليات الأسبوعية لـ كايزنيات ، BodyControl تقنيات جديدة كلياً للتحكم بالجسم وإعادة تعريف وظائفة الحيوية من جديد أو بالأحرى إعادتها إلى صيغتها الطبيعية وهي الأنسب لتفاعلات الجسم مع المعطيات الخارجية مثل: التعامل مع الأكل المدخل ، وكذلك يتم تحسين وإعادة تهيئة الجسم من خلال تقنيات تخفض نسبة الدهون في أماكن محددة في الجسم وتشكيلها لأفضل وأنسب احتمال لها بما يتماشى مع اتساق الجسم بشكل عام .<div><br></div></span>','2014-10-12 21:24:49','2014-10-12 21:24:49',NULL),(5,6,9,'','كايزنيات | LailaMeditation ','','<span>جلسة نقية أسبوعية من التأمل ، هي أحد الفعاليات الأسبوعية لـ كايزنيات ، تعدها وتقدمها أ.ليلى العنزي (ليلى كايزن) بروح جميلة تعيد الإتزان والتفكر لذاتك ، تمتاز جلسات التأمل لليلى كايزن بأنها تعتمد على - الحركة - فسمي بالتأمل الحركي حيث يكون التركيز فيه بالتركيز على حركات معينه تستقبل فيها أفضل طاقة ممكنه في اللّحظة ومن خلالها تستهدف ليلى كايزن العديد من جوانب الحياة للتركيز عليها وإنعاشها في حياتك .<div><br></div></span>','2014-10-12 21:26:23','2014-10-12 21:26:23',NULL),(6,6,5,'','Online:  نظام المناعة الطاقي','','<span>Online: &nbsp;نظام المناعة الطاقي<br>هذه الورشة هي الورشة الأولى التي تقدمها كايزن لكم إلكترونيا من خلال موقعها الجديد وقاعة إلكترونية للمحاضرات مجهزة بالكامل لتلبي جميع احتياجاتك لتستفيد من هذه الورشة بأقصى قدر من الاستفادة والاستمتاع. محاور ورشة العمل:١- طريقة لمعرفة مناعة جسمك إتجاة أفكارك وأهدافك والأشخاص ٢- زيادة وتنشيط نظام المناعة إتجاة الأفكار السلبية والأشخاص والأحداث ٣- المناعة المستقبلية لكل فكرة او حدث تشعر بالخوف منة ٤- التحكم بشعورك إتجاة الأحداث من حولك ٥- عمل مناعة خاصة إتجاة ( عدم الزواج - الفقر - المرض - الألم - عدم الإنجاب - الهجران - الحسد )<br>تقول عن الورشة ا.ليلى كايزن:\"ورشة المناعة الطاقية من أقوى البرامج التي أقدمها إلى الآن، المناعة من الأفكار السيئة والخوف منها. أغلب الناس يفتقدون المناعة من الأمور الخارجية منها المرض، الحسد، المخاوف، أشخاص محددة، الفشل، وغيرها. سنعمل على سيستم للمناعة لكل هذه الأمور، وكذلك بالنسبة للعلاقات الزوجية، يمكنك عمل مناعة من الهجر والخيانة الزوجية والطلاق وغيرها.لكل امرأة لديها صعوبة في الإنجاب ستتعرفين على أسهل الطرق لرفع المناعة التي لديك اتجاه الحمل.لكل شخص يعاني من علاقة عاطفية، ستتدرب على عمل مناعة من هذا الشخص ولن يؤثر فيك بعد اليوم.لكل من يعاني من مدير متسلط أو شركاء عمل ستتدرب على منعهم من حياتك.لكل بنت تعاني من التأخر في الزواج، ستتدريبين على طرق منع هذا التأخير او عدم الزواج.المانع واللامانع هما أكبر قوى ممكن نستخدمهم، نتائجها مذهلة أكبر مما تتصور. ستتدرب على طرق إلغاء المانع من الامور التي تريد والتي تسمى (بلوك).تم تسجيل ١٢٠ مشترك أون لاين من جميع دول العالم. شكرا لثقتكم وسنستمتع مع هذا النظام الذي أحببت مشاركته معكم.\"<br><br>** الورشة ستكون اون لاين فقط ** التاريخ يوم 25-9-2014 ** من ٧-١٠ مساء &nbsp;بتوقيت مكة المكرمة (+3 GMT)<br>يمكنك استخدام نظام Paypal وبطاقة Visa, Mastercard لتفعيل اشتراكك. سنتواصل معك بعد تسجيلك لنوفر لك كل المعلومات التي تحتاجها لتفعيل اشتراكك وحضورك معنا للورشة.<br> وستتوفر لكل شخص من الحضور مادة علمية مكتوبة، يمكنك حفظها على جهازك أو طباعتها إن أحببت، سيتم ارسالها بالإيميل وتوفير نسخة من الملف داخل القاعة الإلكترونية.<br>كما يمكنك الاطلاع خطوات الدخول للنظام والورشة، من خلال هذا الرابط<br> ويمكنك تجربة القاعة بنفسك، من خلال هذا الرابط<br></span>','2014-10-12 21:27:25','2014-10-12 21:27:25',NULL),(7,6,9,'','TheMovieNight #سينما_كايزن','<br>','<span>عندما نحكي عن ما نُحب ! السينما والأفلام تحمل رسائل ومعاني عميقة لكل حكاية تحكي عن نظريات ومفاهيم للحياة والكون ، هنا في كايزن قُرر بأن نخصص يوم في آخر كل شهر ( غالباً آخر خميس ) يوم لعرض أحد أمتع وأعمق الأفلام يوم ممتع مليء <div><br></div></span>','2014-10-12 21:51:37','2014-11-01 18:58:02',NULL),(8,836,8,'How to know my consciousness level?','كيف أقيس وعيي؟','<br>','<div style=\"text-align: right; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px; line-height: normal;\"><br><div dir=\"rtl\"><b>ماهو الوعي؟</b></div><div dir=\"rtl\">هو معلومات عن معلومة واحدة فقط. أنت معلومة، ولديك وعي اتجاه هذه المعلومة.<br></div><div dir=\"rtl\">ماهي معلوماتك عن نفسك؟&nbsp;<br></div><div dir=\"rtl\">يمكنك أن تأخذ وقتك وتقف هنا ولاتكمل قبل أن تراجع &nbsp;نفسك. (ماهي معلوماتي عن نفسي؟)</div><div dir=\"rtl\">كيف ترى نفسك؟ جميلا أم قبيحا..أكمل</div><div dir=\"rtl\">ماهي معلوماتك عن نفسك صحيا؟</div><div dir=\"rtl\">ماهي معلوماتك عن نفسك بالعمل؟</div><div dir=\"rtl\"><br></div><div dir=\"rtl\">استمر وأكتب جميع جوانب حياتك، وهنا ستحصل على مجموعة معلومات.</div><div dir=\"rtl\">كل هذه المعلومات تُشكل وعيك تجاه نفسك.</div><div dir=\"rtl\"><br></div><div dir=\"rtl\">وعيك جزء من وعي جماعي، وعيك متصل مع مجموعة لامحدودة من الوعي.&nbsp;</div><div dir=\"rtl\">كلما ارتفع وعيك فذلك يعني أن معلوماتك تجاه نفسك أصبحت أفضل، فتبدأ بتشكيل وعي جديد لك، فوعيك في تطور مستمر.</div><div dir=\"rtl\"><br></div><div dir=\"rtl\">تطبيق:</div><div dir=\"rtl\"><br></div><div dir=\"rtl\">اكتب معلوماتك عن نفسك -حتى وإن كانت عشوائية- بكل صدق لتعرف درجتك من الوعي.</div><div dir=\"rtl\">اعرف موقعك أولا من ثم قرر أن تتحرك من هذا المكان لتصنع وعيا أنضج.</div><div><br></div></div>','2014-11-09 02:37:09','2014-11-09 02:41:00',NULL);
